import logo from './logo.svg';
import './App.css';
import { TreesContext } from "./";
import react, {useContext} from "react";

function App() {
  const {trees} = useContext(TreesContext);


  return (
    <div>
      <h1>Trees I Have Heard Of</h1>
      <ul>
        {trees.maps((tree) =>
          <li key={tree.id}>{tree.type}</li>
        )}
      </ul>
    </div>
  );
  }


